/****** Object:  UserDefinedFunction [dbo].[get_days]    Script Date: 27.10.2015 9:54:04 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create function [dbo].[get_days](@measure_id int)
returns int
as
begin
declare @i int

select @i = case @measure_id when 1 then  365
when 2 then  30*31*30
when 3 then  30
else 1
end

return @i
end

