CREATE PROCEDURE [dbo].[issdss_job_Delete]
    @AlternativeID int,
    @JobID int
AS
BEGIN
    DELETE FROM job_loop
    WHERE parent_job_id = @JobID OR child_job_id = @JobID
    DELETE FROM job_resource
    WHERE job_id = @JobID
    DELETE FROM plan_job
