/****** Object:  StoredProcedure [dbo].[prc_calculate_task]    Script Date: 27.10.2015 9:54:04 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- select * from task
-- exec prc_calculate_task 3

--select * from crit_value, criteria c
 --       WHERE
  --              crit_value.criteria_id = c.id and task_id = 3


CREATE PROCEDURE [dbo].[prc_calculate_task] @task_id int = 3
AS
BEGIN
        DECLARE @lev    int -- текущий уровень
        DECLARE @max_id int
       
        CREATE TABLE #cr( id int, rank decimal(18,6)) -- МПС
        CREATE TABLE #t(                                                          -- Критерии
                id int,
                lev int,
                method_id int,
                max_value decimal(18,6),
                min_value decimal(18,6),
                primary key(id)
        )                        

        UPDATE
                pair_crit_comp
        SET
                rank = rank + 0.1
        WHERE
                rank = 0
               
        UPDATE
                pair_crit_comp
        SET
                rank = rank - 0.1
        WHERE
                rank = 100
                               
        INSERT INTO #cr( id, rank)
        SELECT
                criteria1_id,
                rank/(100-rank)
        FROM pair_crit_comp
        UNION ALL
        SELECT
                criteria2_id,
                (100-rank)/rank
        FROM pair_crit_comp
       
        -- Корень n-й степени из произведения
        UPDATE
                criteria
        SET
                rank = exp((SELECT      sum(log(#cr.rank))/count(*)
                                FROM    #cr
                                WHERE   #cr.id = criteria.id                    
                                ))
        WHERE
                task_id = @task_id and
                EXISTS( SELECT 1 FROM #cr WHERE #cr.id = criteria.id)  
       
        -- Допущение о равной важности
        UPDATE
                criteria
        SET
                rank = 1
        WHERE
                task_id = @task_id and
                rank is NULL
       
        -- Нормировка
        UPDATE
                criteria
        SET
                rank = rank / ISNULL((SELECT SUM(i.rank)
                                                FROM criteria i
                                                WHERE ISNULL(i.parent_crit_id,0) =
                                                      ISNULL(criteria.parent_crit_id,0) AND
                                                      i.rank > 0
                                        ),1)
        WHERE
                task_id = @task_id
               

        -- Удалить все расчетные значения
        DELETE
                crit_value
        FROM
                criteria c
        WHERE
                crit_value.criteria_id = c.id AND
                c.task_id = @task_id AND
                crit_value.person_id IS NULL
       
        SELECT @max_id = ISNULL(( SELECT MAX(id) FROM crit_value),0)

        INSERT INTO crit_value( id, criteria_id, alternative_id )
        SELECT
                ROW_NUMBER() OVER( ORDER BY a.id, c.id) + @max_id,
                c.id,
                a.id
        FROM
                criteria c,
                alternative a
        WHERE
                a.task_id = @task_id AND
                c.task_id = @task_id
                       
        SELECT @lev = 0
        -- Корни
        INSERT INTO #t ( id, method_id, lev )
        SELECT id, method_id, @lev
        FROM criteria
        WHERE task_id = @task_id AND parent_crit_id IS NULL
               
        WHILE EXISTS( SELECT 1 FROM criteria
                      WHERE parent_crit_id IN (SELECT id FROM #t WHERE lev = @lev ))
              AND @lev < 10000 -- защита от зацикливания
        BEGIN
                SELECT @lev = @lev + 1
                INSERT INTO #t ( id, method_id, lev)
                SELECT id, method_id, @lev FROM criteria
                WHERE parent_crit_id IN (SELECT id FROM #t WHERE lev = (@lev-1) )
        END
       
        -- От листвы к корням  
        WHILE @lev >=0
        BEGIN
                       
                UPDATE
                        crit_value
                SET
                        value = (
                                SELECT
                                        SUM((cv.value-tt.min_value)*c.rank
                                             /(tt.max_value - tt.min_value)
                                           )
                                FROM
                                        criteria c
                                        join crit_value cv on c.id = cv.criteria_id
                                        join #t tt on tt.id = c.id
                                WHERE
                                        c.parent_crit_id = #t.id AND
                                        cv.alternative_id = crit_value.alternative_id AND
                                        cv.person_id IS NULL
                        )
                FROM
                        #t
                WHERE
                        #t.id  = crit_value.criteria_id AND
						#t.method_id in ( 1, 2) AND       -- взвешенная сумма
                        #t.lev = @lev AND
                        EXISTS(SELECT 1 FROM criteria c    -- Только если обощенный!
                               WHERE c.parent_crit_id = #t.id)

				-- нечеткий минимум

				UPDATE
                        crit_value
                SET
                        value = (
                                SELECT
                                        MIN(cv.value)
                                FROM
                                        criteria c
                                        join crit_value cv on c.id = cv.criteria_id
                                        join #t tt on tt.id = c.id
                                WHERE
                                        c.parent_crit_id = #t.id AND
                                        cv.alternative_id = crit_value.alternative_id AND
                                        cv.person_id IS NULL
                        )
                FROM
                        #t
                WHERE
                        #t.id  = crit_value.criteria_id AND
						#t.method_id = 7 AND
                        #t.lev = @lev
						AND (SELECT TOP 1 is_number FROM criteria WHERE crit_value.criteria_id = criteria.id) = 0

				-------

				
				-- нечеткий метод с функцией принадлежности

				UPDATE
                        crit_value
                SET
                        value = (
                                SELECT TOP 1
                                        [dbo].[GetFuzzyValueEstimation](c.id, cv.value)
                                FROM
                                        criteria c
                                        join crit_value cv on c.id = cv.criteria_id
                                        join #t tt on tt.id = c.id
                                WHERE
                                        c.parent_crit_id = #t.id AND
                                        cv.alternative_id = crit_value.alternative_id AND
                                        cv.person_id IS NULL
                        )
                FROM
                        #t
                WHERE
                        #t.id  = crit_value.criteria_id AND
						#t.method_id = 7 AND
                        #t.lev = @lev
						AND (SELECT TOP 1 is_number FROM criteria WHERE crit_value.criteria_id = criteria.id) = 1

				-------

                UPDATE
                        crit_value
                SET 
                        value = case when 
                        exists(
                                SELECT
                                        1
                                FROM
                                        criteria c
                                        join crit_value cv on c.id = cv.criteria_id
                                        join #t tt on tt.id = c.id
                                WHERE
										cv.value = 0 AND
                                        c.parent_crit_id = #t.id AND
                                        cv.alternative_id = crit_value.alternative_id AND
                                        cv.person_id IS NULL
                        )
                         then 0
                        else
                        exp((
                                SELECT
                                        SUM(log(cv.value)*c.rank)
                                FROM
                                        criteria c
                                        join crit_value cv on c.id = cv.criteria_id
                                        join #t tt on tt.id = c.id
                                WHERE
										cv.value <> 0 AND
                                        c.parent_crit_id = #t.id AND
                                        cv.alternative_id = crit_value.alternative_id AND
                                        cv.person_id IS NULL
                        ))
                        end
                FROM
                        #t
                WHERE
                        #t.id  = crit_value.criteria_id AND
						#t.method_id = 6 AND
                        #t.lev = @lev AND
                        EXISTS(SELECT 1 FROM criteria c    -- Только если обощенный!
                               WHERE c.parent_crit_id = #t.id)
                               
                UPDATE
                        crit_value
                SET
                        value = ISNULL((
                                SELECT
                                        AVG(ISNULL(cs.rank,ISNULL(cv.value,0)))
                                FROM
                                        crit_value cv
                                        left outer join crit_scale cs on cs.id = cv.crit_scale_id
                                WHERE
                                        cv.criteria_id = #t.id AND
                                        cv.alternative_id = crit_value.alternative_id AND
                                        NOT (cv.person_id IS NULL)
                        ),0)
                FROM
                        #t
                WHERE
                        #t.id  = crit_value.criteria_id AND
                        #t.lev = @lev AND
                        crit_value.person_id IS NULL AND
                        NOT EXISTS(SELECT 1 FROM criteria c    -- Только если исходный
                                   WHERE c.parent_crit_id = #t.id)
                                   
                UPDATE
                        #t
                SET
                        max_value = (
                                SELECT
                                        max(ISNULL(cv.value,0))
                                FROM
                                        crit_value cv
                                WHERE
                                        cv.criteria_id = #t.id AND
                                        cv.person_id IS NULL
                        ),
                        min_value = (
                                SELECT
                                        min(ISNULL(cv.value,0))
                                FROM
                                        crit_value cv
                                WHERE
                                        cv.criteria_id = #t.id AND
                                        cv.person_id IS NULL
                        )                      
                WHERE
                        #t.lev = @lev
                       
                UPDATE
                        #t
                SET
                        max_value = max_value + 1  -- Шаман однако
                WHERE
                        (max_value - min_value) < 1
                                                       
                SELECT @lev = @lev - 1
        END
       
        UPDATE
                alternative
        SET
                rank = ( SELECT
                                                AVG(ISNULL(cv.value,0))
                                   FROM
                                                crit_value cv
                                                join #t on #t.id = cv.criteria_id
                                               
                                  WHERE
                                                #t.lev = 0 AND
                                                cv.alternative_id = alternative.id AND
                                                cv.person_id IS NULL
                                )
        WHERE
                task_id = @task_id

				select * from #t
				select * from #cr

        DROP TABLE #cr
        RETURN 1
END

GO
/****** Object:  StoredProcedure [dbo].[prc_criteria_copy]    Script Date: 27.10.2015 9:54:04 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

create procedure [dbo].[prc_criteria_copy]( @src_task int, @target_task int)
as
begin
declare @id int

CREATE TABLE #t(
	new_id int,
	src_id int,
	p_id   int
)

select @id = isnull((select max(id) from criteria),0) + 1

insert into #t (new_id, src_id, p_id)
select ROW_NUMBER() OVER( ORDER BY id) + @id, id, parent_crit_id
from criteria
where task_id = @src_task

insert into criteria (id,task_id,name,ismin,idealvalue,method_id,descr)
select #t.new_id, @target_task, c.name, c.ismin, c.idealvalue, c.method_id, c.descr
from #t join criteria c on c.id = #t.src_id

update 
		criteria 
set
		parent_crit_id = tt.new_id
from #t t join #t tt on tt.src_id = t.p_id 
where t.new_id = id

select @id = isnull((select max(id) from crit_scale),0) + 1

insert into crit_scale (id, criteria_id, name,rank,ord)
select 
	ROW_NUMBER() OVER( ORDER BY id) + @id,
	t.new_id,
	c.name,
	c.rank,
	c.ord
from
	crit_scale c join #t t on t.src_id = c.criteria_id            

select @id = isnull((select max(id) from alternative),0) + 1

insert into alternative(id, task_id, name)
select 
	ROW_NUMBER() OVER( ORDER BY id) + @id,
	@target_task,
	name
from
	alternative
where 
	task_id = @src_task
	
drop table #t

end

GO
/****** Object:  StoredProcedure [dbo].[prc_dssplan]    Script Date: 27.10.2015 9:54:04 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create procedure [dbo].[prc_dssplan] ( @plandss int )
as
begin

declare @t int,                 -- Параметр цикла по времени.
@t_temp int,                    -- Переменная для заполнения временной таблицы ресурсов.
@period int,                    -- Параметр временного периода.
@curr_alt int,                  -- Индекс рассматриваемой альтернативы.
@curr_job int,                  -- Индекс рассматриваемой работы.
@begin_date datetime,   -- Дата начала плана.
@end_date  datetime             -- Дата окончания плана.


-- Удаление старого плана.
delete plan_job
where plan_id = @plandss

-- *** Рассчет вспомагательных значений. ***

set @begin_date =
(select pdss.begin_date
from plandss pdss
where pdss.id = @plandss)

set @end_date =
(select pdss.end_date
from plandss pdss
where pdss.id=@plandss)

set @period =
(select datediff(d, plandss.begin_date, plandss.end_date)
from plandss
where plandss.id = @plandss)

-- *** Создание временной таблицы ресурсов. ***
create table #temp_resource(id int IDENTITY(1,1), res_id int, t_begin int, t_end int, value decimal(18,6), ispeak int)

-- *** Создание временной таблицы запланированных работ. ***
create table #temp_plan(id int IDENTITY(1,1), plan_id int, job_id int, begin_date datetime, end_date datetime)

-- Первичное заполнение временной таблицы.
-- Непиковые ресурсы.
set @t_temp = 1
while @t_temp <= @period
begin   -- Блок заполнения временной таблицы.
insert into #temp_resource
select r.id, @t_temp, @t_temp + r.period - 1, r.value, 0
from
(select *
from resource r
where (r.period <> 0) and (r.period is not NULL)) r
where ((@t_temp - 1 + r.period) % r.period)=0

-- Пиковые ресурсы.
insert into #temp_resource
select r.id, @t_temp, @t_temp, r.value, 1
from resource r
where (r.period = 0) or (r.period is NULL)

set @t_temp = @t_temp + 1                                       -- Проходим по всем дням.
end     -- Блок заполнения временной таблицы.

declare alt_cursor cursor
    for select a.id
    from alternative a
    order by a.rank desc
OPEN alt_cursor
FETCH NEXT FROM alt_cursor
into @curr_alt
while @@FETCH_STATUS=0

begin   -- Начало внешнего цикла (по экспериментам или альтернативам).

declare job_cursor cursor
    for select j.id
    from job j
    where j.alternative_id = @curr_alt
    order by j.id
OPEN job_cursor
FETCH NEXT FROM job_cursor
into @curr_job
while @@FETCH_STATUS=0 -- Начало внутреннего цикла (по работам).

begin   -- Начало внутреннего цикла (по работам).

set @t=1
while @t<@period

begin   -- Начала цикла по времени для планирования работ, принадлежащих текущему экперименту.

if @curr_job not in
(select p_j.job_id
from plan_job p_j
where p_j.plan_id = @plandss)

/* в стадии отладки and

(select min(isnull(check_job_loop.result, 1))
from
(select
        case
                when p_j.end_date is not NULL and p_j.end_date >= dateadd(d, @t,@begin_date) then 0            
                when p_j.end_date is NULL then 1
                        else 1
                end result
from plan_job p_j
right join (select j_l.parent_job_id
from job_loop j_l
where j_l.child_job_id = @curr_job) j_l
        on p_j.job_id = j_l.parent_job_id) check_job_loop) <> 0 */
       
begin -- Блок проверок (учет вхождения в другие планы и в job_loop).


-- *** Планирование экспериментов. ***
insert into #temp_plan
-- Выбор приоритетной группы экспериментов, удовлетворяющих условиям.
select
@plandss,                                                                       -- Номер плана.
j1.id,                                                                          -- ID работы.
dateadd(d,@t-1,@begin_date),                            -- Дата начала работы.
dateadd(d,j1.duration + @t - 1,@begin_date)     -- Дата конца работы.
from job j1
where j1.id = @curr_job                                                                                
and dateadd(d,@t + j1.duration - 1,@begin_date) <= @end_date    -- Укладываются в период планирования.
and j1.id not in                                                                                                -- Еще не запланированы.
(select p_j.job_id
from plan_job p_j) and
j1.id not in
(select p.job_id
from #temp_plan p
where p.plan_id = @plandss) and
(select min(comparison.result)
from
(select
                case
                        when r.ispeak = 0 and @t >= r.t_begin and @t + j.duration <= r.t_end then r.value - j.per_day*(j.duration + 1)
                        when r.ispeak = 0 and @t < r.t_begin and @t + j.duration <= r.t_end and @t + j.duration > r.t_begin then r.value - j.per_day*(@t + j.duration - r.t_begin + 1)
                        when r.ispeak = 0 and @t >= r.t_begin and @t <= r.t_end and @t + j.duration > r.t_end then r.value - j.per_day*(r.t_end - @t + 1)
                        when r.ispeak = 0 and @t < r.t_begin and @t + j.duration > r.t_end then r.value - j.per_day*(r.t_end - r.t_begin + 1)
                        when r.ispeak = 1 and r.t_begin >= @t and r.t_begin <= @t + j.duration then r.value - j.value
                        else 0
                end result
from  #temp_resource r join
(select j_r.resource_id, j_r.value/(j.duration /*+ 1*/) per_day, j.duration, j_r.value
from job j join job_resource j_r
on j.id = j_r.job_id
where j.id = @curr_job) j on j.resource_id = r.res_id) comparison) >= 0


-- Перерасчет ресурсов, если на данной итерации были запланированы эксперименты.
if (select COUNT(*)
from #temp_plan) <> 0
begin   -- Блок перерасчета временной таблицы.
-- Переносим данные из временной таблицы.
insert into plan_job
select *
from #temp_plan

set @t_temp = @t

-- Перерасчет временной таблицы начиная с текущего момента.

while @t_temp <=
(select j.duration + @t
from job j
where j.id = @curr_job)

begin  

update #temp_resource
set value =
        case
                when r.ispeak = 0 then r.value - j.per_day
                else  r.value - j.value
        end
from #temp_resource r join
(select j_r.resource_id, j_r.value/(j.duration/*+ 1*/) per_day, j_r.value
from job j join job_resource j_r
        on j.id = j_r.job_id
where j.id = @curr_job) j
        on j.resource_id = r.res_id
where r.t_begin <= @t_temp and r.t_end >= @t_temp

set @t_temp = @t_temp + 1

end    

delete #temp_plan       -- Очищаем таблицу запланированных работ после перерасчета таблицы ресурсов.
end     -- Блок перерасчета временной таблицы.


end -- Блок проверок (учет вхождения в другие планы и в job_loop).

set @t=@t+1                             -- Следующий временной отрезок.

end     -- Блок цикла по времени для планирования работ, принадлежащих текущему экперименту.

FETCH NEXT FROM job_cursor              -- Следующая работа в списке.
into @curr_job

end             -- Конец внутреннего цикла (по работам).

deallocate job_cursor


-- Отмена альтернатив, для которых не удалось запланировать все работы.
if
(select COUNT(*)
from job j
where j.alternative_id = @curr_alt)
 <> -- Проверка, были ли запланированы все работы, принадлежащие текущей альтернативе.
(select COUNT(*)
from job j join plan_job p_j on j.id = p_j.job_id
where j.alternative_id = @curr_alt)
begin


-- Расчет начала периода, с которого надо производить возврат ресурсов.
set @t_temp = (select MIN(DATEDIFF(d, @begin_date, p_j.begin_date))
from plan_job p_j join job j
        on p_j.job_id = j.id
where j.alternative_id = @curr_alt )


-- Расчет конца периода, с которого надо производить возврат ресурсов.
while @t_temp <= (select MAX(DATEDIFF(d, @begin_date, p_j.end_date))
from plan_job p_j join job j
        on p_j.job_id = j.id
where j.alternative_id = @curr_alt )

begin

-- Возврат ресурсов от отмененных экспериментов.
update #temp_resource
set value =
        case
                when r.ispeak = 0 then r.value + isnull(j.per_day, 0)
                else r.value + isnull(j.value, 0)
        end
from #temp_resource r left join
(select j_r.resource_id, SUM(j_r.value/(j.duration/*+ 1*/)) per_day, SUM(j_r.value) value
from job j join job_resource j_r
        on j.id = j_r.job_id
where j.alternative_id = @curr_alt and j.id in
(select p_j.job_id
from plan_job p_j
where p_j.begin_date <= dateadd(d,@t_temp,@begin_date) and p_j.end_date >= dateadd(d,@t_temp,@begin_date))
group by j_r.resource_id) j
        on j.resource_id = r.res_id
where r.t_begin <= @t_temp and r.t_end >= @t_temp


set @t_temp = @t_temp + 1

end  -- Конец блока цикла отмены экспериментов.

        -- Удаление отмененных экспериментов из списка.
delete plan_job
where job_id in
(select j.id
from job j
where j.alternative_id =  @curr_alt )

end     -- Конец блока отмены экспериментов.



FETCH NEXT FROM alt_cursor              -- Следующий эксперимент в списке.
into @curr_alt

end     -- Конец внешнего цикла (по экспериментам или альтернативам).

deallocate alt_cursor
drop table #temp_plan
drop table #temp_resource

end

GO
/****** Object:  StoredProcedure [dbo].[prc_plandss]    Script Date: 27.10.2015 9:54:04 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO


create procedure [dbo].[prc_plandss] ( @plan_id int = 1)
as
begin
declare @task_id    int
declare @begin_date datetime
declare @end_date   datetime
declare @t          int
declare @max_t      int
declare @min_t      int
declare @job_id     int
declare @duration   int
declare @id         int

create table #job(
	id int,
	t int,
	duration int,
	rank decimal(18,6),
	nores int default 0
)

create table #t(
	t int
)

create table #res(
	id int,
	t1 int,
	t2 int,
	v decimal(18,6)
)

create table #jobres(
	job_id int,
	res_id int,
	v decimal(18,6)
)


select @task_id=task_id, @begin_date=begin_date, @end_date=end_date  
from plandss where id = @plan_id

insert into #job ( id, duration, rank)
select j.id, j.duration, a.rank
from job j
join alternative a on j.alternative_id = a.id
where a.task_id = @task_id

insert into #jobres( job_id, res_id, v)
select jr.job_id, jr.resource_id, case when r.period is null then jr.value * j.duration else jr.value end  
from 
job_resource jr
join resource r on r.id = jr.resource_id
join job j on jr.job_id = j.id
join alternative a on j.alternative_id = a.id
where a.task_id = @task_id


-- все дни
select @max_t = datediff(day,@begin_date, @end_date)+1
set @t = 0
while @t <= @max_t
begin
	insert into #t(t) values (@t)
	set @t = @t +1
end

-- мощностные
insert into #res(id, t1, t2, v)
select r.id, #t.t, #t.t, r.value
from resource r, #t 
where r.task_id = @task_id and isnull(r.period,0) = 0

--складируемые
insert into #res(id, t1, t2, v)
select r.id, #t.t, #t.t + r.period*dbo.get_days(r.measure_id) - 1, r.value
from resource r
     join #t on (#t.t % (r.period*dbo.get_days(r.measure_id) ))=0  
where r.task_id = @task_id and r.period > 0

-- хвост
update
	#res
set
	v = v*(@max_t-t1+1)/(t2-t1+1)
where 
    t2 > @max_t
   

while (1=1)
begin
	set @job_id = (select top 1 j.id 
	               from #job j 
	               where j.t is null and j.nores = 0 and 
	                     not exists( select 1 from #job pj join job_loop jl on jl.parent_job_id = pj.id where jl.child_job_id = j.id and pj.t is null)             
	               order by j.rank DESC, j.id ASC
	              )
	              
	if (@job_id is null) break
	
	select @duration = duration from #job where id = @job_id
	
	set @min_t = (select min(t) 
	              from #t                               -- от t до t+@duration-1 
	              where ( select count(*)  
	                       from #jobres jr join #res on #res.id = jr.res_id   
	                        where jr.job_id = @job_id and #res.t1 <= (#t.t + @duration - 1 ) and #res.t2 >= #t.t 
	                    ) =
	                    ( select count(*)  
	                       from #jobres jr join #res on #res.id = jr.res_id   
	                        where jr.job_id = @job_id and #res.t1 <= (#t.t + @duration - 1 ) and #res.t2 >= #t.t and
	                              #res.v >= case when #res.t1 <= #t.t then
	                                                  case when #res.t2 >= (#t.t + @duration - 1 ) then
	                                                  		1
	                                                  else
	                                                  		convert(decimal(18,6),(#res.t2 - #t.t + 1)) / @duration
	                                                  end
	                                             else
	                                             	  case when #res.t2 >= (#t.t + @duration - 1 ) then
	                                                  		convert(decimal(18,6),((#t.t + @duration - 1 ) - #res.t1 + 1)) / @duration
	                                                  else
	                                                  		convert(decimal(18,6),(#res.t2 - #res.t1 + 1)) / @duration
	                                                  end
	                                        end * jr.v 
	                    ) and
	                    (#t.t + @duration - 1 ) < @max_t 
	             )       
	
    update
    		#job
    set 
    		t = @min_t,
    		nores = case when @min_t is null then 1
    		             else 0
    		        end
    where 
    		id = @job_id
   
   		
   if (@min_t is null) continue
   
   update
   		#res
   set 
   		v = #res.v - case when #res.t1 <= @min_t then
	                           case when #res.t2 >= (@min_t + @duration - 1 ) then
	                                 1
	                           else
	                                 convert(decimal(18,6),(#res.t2 - @min_t + 1)) / @duration
	                           end
	                  else
	                           case when #res.t2 >= (@min_t + @duration - 1 ) then
	                                 convert(decimal(18,6),((@min_t + @duration - 1 ) - #res.t1 + 1)) / @duration
	                           else
	                                 convert(decimal(18,6),(#res.t2 - #res.t1 + 1)) / @duration
	                           end
	            end * jr.v 
   from #jobres jr
   where #res.id = jr.res_id and 
         jr.job_id = @job_id and 
         #res.t1 <= (@min_t + @duration - 1 ) and #res.t2 >= @min_t 
 
end
   
delete plan_job where plan_id = @plan_id

select @id = ISNULL(( select max(id) from plan_job),0)

insert into plan_job( id, plan_id, job_id, begin_date, end_date )
select
                row_number() over( order by id, t) + @id,
                @plan_id,
                id,
                dateadd(day,t,@begin_date),
                dateadd(day,t+duration-1,@begin_date)
from #job
where nores = 0 and t is not null


drop table #res                
drop table #job
drop table #jobres
drop table #t
end

